Let's place our variables: let $n$ represent the number of nickels and $d$ represent the number of dimes. We know the following:
1. The total number of coins is 11: $n + d = 11$
2. The total value of the coins in cents is 75: $5n + 10d = 75$
We want to solve for $n$, the number of nickels. Let's multiply the first equation by 5 to get rid of $d$: 5d + 5n = 55
Now we add the two equations together by adding the left sides and the right sides separately (rather than adding the $d$ terms together):  \begin{align*}
5d + 5n + 5n + 10d &= 55 + 75\\
15d + 10n &= 130
\end{align*}
Now we divide by 5 to isolate the term with $n$: \begin{align*}
15d + 10n &= 130\\
\frac{15d + 10}{5} &= \frac{130}{5}\\
3d + 2n &= 26
\end{align*}
Finally, we subtract $3d$ and divide by 2 from both sides to isolate $n$.  \begin{align*}
3d + 2n &= 26\\
2n &= 26 - 3d\\
n &= \frac{26 - 3d}{2}
\end{align*}
Since $n$ represents the number of nickels (a whole number), $26 - 3d$ must be divisible by 2. Therefore $3d$ must be odd. The only possibility is $3d = 24$, which implies that $d = 8$ and $n = \frac{26 - 3(8)}{2} = \boxed{4}$. The answer is 4
